const About = () => {
  <link href="About.css" rel="stylesheet" type="text/css" />

  return <>
  <h1 class="title">About</h1>
  <p>Faker text is likewise used to show the presence of various typefaces and formats, and by and large, the substance of the sham text is absurd. Because of its far and wide use as filler text for formats, non-lucidness is vital: human discernment is tuned to perceive specific examples and redundancies in texts. If the conveyance of letters and ‘words’ is irregular, the peruser won’t be diverted from making a nonpartisan judgment on the visual effect.</p>
  </>
};

export default About;
